import './App.css';
import { reduxForm, Field } from 'redux-form';

function App() {
  return (
    <div className="App">
      <button>Clicked X Times</button>
      <label>Rollover X Times</label>
    </div>
  );
}

App = reduxForm({
  // a unique name for the form
  form: 'contact'
})(App)
export default App;
